import { Avatar } from 'react-native-paper';

const UserPic = ({name}) => (
  <React.Fragment> 
  <Avatar.Image size={32} source={require('../assets/avatarIMG.jpg')} />
  <Text> {name}</Text>
  </React.Fragment>
);
export default UserPic
